            <div className='mt-64 flex items-center justify-center'>

                <div>
                    <Typewriter 
                        options = {{
                            strings: ["Welcome", "Bienvenido", "Salut", "Privet", "Yōkoso"],
                            autoStart: true,
                            loop: true,
                            cursor: "_"
                        }}
                    />
                </div>

            </div>
        );
    }
}
